import { FacebookProvider, Page, MessageUs } from 'react-facebook';

function Whatsapi(){
    return (
      <FacebookProvider appId="716244130372865">
        <Page href="https://www.facebook.com/profile.php?id=100064278240012" tabs="timeline" />
        <MessageUs messengerAppId="716244130372865" pageId="100064278240012"/>
      </FacebookProvider>
    );
}
export default Whatsapi
